var closestRoom2 = function (rooms, queries) {
    rooms.sort((a, b) => {
        return a[0] - b[0];
    })
    console.log(rooms.join(' '));
    // console.log(queries.join(' '));

    let findPos = (rooms, dst) => {
        let left = 0, right = rooms.length - 1;
        let target = dst;
        while (left <= right) {
            let mid = left + Math.floor((right - left) / 2);
            if (target < rooms[mid][0]) {
                right = mid - 1;
            } else if (target > rooms[mid][0]) {
                left = mid + 1;
            } else {
                left = mid;
                break;
            }
        }
        return left;
    }

    let n = rooms.length;
    let k = queries.length;
    let res = new Array(k).fill(-1);
    for (let i = 0; i < k; i++) {
        let curr = queries[i];
        let start = findPos(rooms, curr[0]);
        let left = start - 1, right = start;
        // console.log(`start ${start}`);
        let currRes = [-1, -1];
        while (left >= 0 || right < n) {
            if ((left >= 0 && left < n)
                && rooms[left][1] >= curr[1]
                && currRes[0] == -1) {
                currRes[0] = rooms[left];
            }
            if (right < n
                && rooms[right][1] >= curr[1]
                && currRes[1] == -1) {
                currRes[1] = rooms[right];
            }
            if (currRes[0] != -1 && currRes[1] == -1 && (right >= n || rooms[right][0] - curr[0] > curr[0] - currRes[0][0])) {
                res[i] = currRes[0][0];
                break;
            }
            if (currRes[1] != -1 && currRes[0] == -1 && (left < 0 || curr[0] - rooms[left][0] > currRes[1][0] - curr[0])) {
                res[i] = currRes[1][0];
                break;
            }
            if(currRes[0] != -1 && currRes[1] != -1) {
                let diff = currRes[1][0] - curr[0] - (curr[0] - currRes[0][0]);
                if(diff < 0) {
                    res[i] = currRes[1][0];
                } else {
                    res[i] = currRes[0][0];
                }
                break;
            }
            left--;
            right++;
        }
    }
    return res;
};

